import classes from "./History.module.css";

export default function HistoryBuyTable() {
  return (
    <div>
      <table className={classes.generalTable}>
        <thead>
          <tr>
            <td># п/п</td>
            <td>Никнейм модератора</td>
            <td>Дата обмена</td>
            <td>Наименование услуги</td>
            <td>Количество</td>
            <td>Цена</td>
            <td>Действие</td>
          </tr>
        </thead>
      </table>
    </div>
  );
}
